import React from "react";
import "./Card.css";

export interface CardProps {
	borderRadius?: string;
}

class Card extends React.Component<CardProps, {}> {
	render() {
		return (
			<div className="CardWrapper">
				<div className="Card"></div>
			</div>
		);
	}
}

export default Card;
